import './App.css';
import List from './Components/List';

function App() {

  const orderList = [
    {
      id:"1",
      order:"Paneer Pulav",
      prize:123
    }
  ]

  return (
    <div>
        <label>ID : </label>
        <input id="uniqueId" type="number"></input>
        <label>Order : </label>
        <input id="orderName" type="text"></input>
        <label>Prize : </label>
        <input id="prize" type="number"></input>
        <label>Select Table : </label>
        <select >
          <option value="1">Table 1</option>
          <option value="2">Table 2</option>
          <option value="3">Table 3</option>
        </select>
       {orderList.map((order)=>{return (<List id={order.id} order={order.order} prize={order.prize}></List>)})}
    </div>
  );
}

export default App;
